// src/components/Skills.js
import React from 'react';
import './Skills.css';

const Skills = () => {
    return (
        <div className="container-content">
            <h2>Skills</h2>
            <ul>
                <li>Python</li>
                <li>HTML/5 css</li>
                <li>C</li>
                <li>JavaScript</li>
                <li>React</li>
                <li>Node.js</li>
                <li>Bash/Shell</li>
                <li>MySQL</li>
                <li>Version Control</li>
                <li>Scripting and Automation</li>
                <li>Remote Desktop Tools</li>
                <li>Networking</li>
            </ul>
        </div>
    );
};

export default Skills;
